import { useState, useEffect } from "react";
import autologo from "./assets/myauto.png";

import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Manufacturer } from "./domain/manufacturer";
import { Cat } from "./domain/cat";
import { Product } from "./domain/product";
import { Model } from "./domain/model";

import {
  Button,
  ButtonGroup,
  Dropdown,
  InputGroup,
  FormControl,
} from "react-bootstrap";

const api1 = "https://static.my.ge/myauto/js/mans.json";
const api2 = "https://api2.myauto.ge/ka/getManModels?man_id=10";
const api3 = "https://api2.myauto.ge/ka/cats/get";
const api4 = "https://api2.myauto.ge/ka/products/";

function App() {
  const [manufacturers, setmanufacturers] = useState<Manufacturer[]>([]);
  const [models, setmodels] = useState<Model[]>([]);
  const [cat_lst, setcat_lst] = useState<Cat[]>([]);
  const [product_lst, setproduct_lst] = useState<Product[]>([]);
  const [loading, setloading] = useState(true);
  const [currency, setCurrency] = useState<string>("$");

  $(document).ready(function () {
    $('input[type="checkbox"]').on("change", function () {
      if ($(this).is(":checked")) {
        $(".switch-container > span").toggleClass("active");
      } else {
        $(".switch-container > span").toggleClass("active");
      }
    });
  });
  const fetchManufacturers = async () => {
    try {
      const response = await fetch(api1);
      const data = await response.json();
      setmanufacturers(data);
      console.log(data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchModels = async () => {
    try {
      const response = await fetch(api2);
      const data = await response.json();

      setmodels(data.data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchCatList = async () => {
    try {
      const response = await fetch(api3);
      const data = await response.json();

      setcat_lst(data.data);
    } catch (error) {
      console.error(error);
    }
  };

  const fetchProductList = async () => {
    try {
      const response = await fetch(api4);
      const data = await response.json();

      setproduct_lst(data.data.items);
    } catch (error) {
      console.error(error);
    }
  };

  useEffect(() => {
    fetchManufacturers();
    fetchModels();
    fetchCatList();
    fetchProductList();
    // const M = new Manufacturer(1314, "ye", 13, 14, 15);
    // M.barks();
  }, []);

  useEffect(() => {
    setloading(false);
  }, [manufacturers, models, cat_lst, product_lst]);

  const cat = <div>loaded</div>;

  type RadioType = {
    id: string;
    name: string;
    value: string;
  };

  const radios: RadioType[] = [
    { id: "radio1", name: "Radio 1", value: "radio1" },
    { id: "radio2", name: "Radio 2", value: "radio2" },
    { id: "radio3", name: "Radio 3", value: "radio3" },
  ];
  // console.log(product_lst[0]);
  // console.log(product_lst[0]?.bark());
  return (
    <div style={{ backgroundColor: "lightgrey" }}>
      <header className="bg-light">
        <nav className="navbar navbar-expand-lg navbar-light">
          <div className="container">
            <a className="navbar-brand" href="#">
              <img src={autologo} alt="myauto" className="header-logo" />
            </a>
          </div>
        </nav>
      </header>
      {loading ? <div>loading</div> : cat}

      <div
        style={{
          maxWidth: "20%",
          padding: "1rem",
          backgroundColor: "rgb(255, 255, 255)",
          boxSizing: "border-box",
          marginLeft: "10%",
        }}
      >
        <div className="btn-group btn-group-lg w-100 mb-3">
          <Button variant="outline-primary" className="w-100">
            Cars
          </Button>
          <Button variant="outline-primary" className="w-100">
            Trucks
          </Button>
          <Button variant="outline-primary" className="w-100">
            Motorcycles
          </Button>
        </div>

        <div className="mb-3">
          <Dropdown className="mb-2">
            <Dropdown.Toggle
              variant="success"
              id="dropdown-basic"
              className="w-100"
            >
              Selling Type
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>

          <Dropdown className="mb-2">
            <Dropdown.Toggle
              variant="success"
              id="dropdown-basic"
              className="w-100"
            >
              Manufacturer
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>

          <Dropdown className="mb-2">
            <Dropdown.Toggle
              variant="success"
              id="dropdown-basic"
              className="w-100"
            >
              Category
            </Dropdown.Toggle>
            <Dropdown.Menu>
              <Dropdown.Item href="#/action-1">Value 1</Dropdown.Item>
              <Dropdown.Item href="#/action-2">Value 2</Dropdown.Item>
              <Dropdown.Item href="#/action-3">Value 3</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </div>

        <div className="mb-3">
          <div className="d-flex justify-content-between align-items-center mb-2">
            <span>Price</span>
            <div className="switch-container">
              <span>₾</span>
              <label className="switch">
                <input type="checkbox" />
                <span className="slider"></span>
              </label>
              <span>$</span>
            </div>
          </div>
          <InputGroup className="mb-3 d-flex align-items-center">
            <FormControl placeholder="From" className="mr-2" />
            <span>-</span>
            <FormControl placeholder="Max" className="ml-2" />
          </InputGroup>
        </div>

        <InputGroup className="mb-3">
          <FormControl placeholder="Search" />
          <InputGroup.Text id="inputGroup-sizing-default">
            197963
          </InputGroup.Text>
        </InputGroup>
      </div>
    </div>
  );
}

export default App;
